/* eslint-disable no-unused-vars */
import * as BookAPI from '../BooksAPI';

const Output = (setResult, searchWord) =>{
    
    if(typeof searchWord ==='string'){
        const SearchResult = async () =>{
            const data = await BookAPI.search(searchWord);
            return data;
        }
        SearchResult()
            .then(res => {setResult([...res]);console.log(...res)})
                .catch(() => {
                    console.log('%c Error occured when fetching books',
                    'background-color:black; font-size:40px;color:red;');
        });
    }
    
}
export default Output;
